/****** FUNCTION PROTOTYPES *****/
void setup(void);
void loop(void);
void updateOutputs(void);
void fadeall(void);

/***** DEFINITION OF DIGITAL OUTPUT PINS *****/
const uint8_t led_P9813_DIN_PIN_D2 = 2;
const uint8_t led_P9813_CIN_PIN_D3 = 3;

/***** DEFINITION OF OUTPUT RAW VARIABLES *****/
